import { BrowserRouter as Router, Route, Switch } from 'react-router-dom';
import './index.css';
import Navbar from "./components/Navbar";
import Secondimg from './components/Secondimg';
import Grounds from './components/Grounds';
import Footer from './components/Footer';


function App() {
  return (
<Router>
  <div className="App">

    <Navbar/>

    <Secondimg/>
    <Switch>
    <Route path="/" exact component={Secondimg} />
          <Route path="/grounds" component={Grounds} />
    </Switch>
    <Footer/>
  </div>
</Router>
  )}
  export default App
